import profile_photo from "./../images/HL WONG.png"

const frequency = document.querySelectorAll(".frequency")
let frequency_selected

export default function Profile() {
    function onClickfrequency() {
        frequency.classList.toggle("active");
        console.log(frequency)
    }

    return (
        <div className="report__container">
            <div className="report__profile">
                <img src={profile_photo} alt="" className="profile__photo"/>
                <div>
                    <p className="profile__report">Report for</p>
                    <p className="profile__name">HL Wong</p>
                </div>
            </div>
            <div className="report__frequency">
                <p className="frequency__daily frequency" onclick={onClickfrequency}>Daily</p>
                <p className="frequency__weekly frequency" onclick={onClickfrequency}>Weekly</p>
                <p className="frequency__monthly frequency" onclick={onClickfrequency}>Monthly</p>
            </div>
        </div>
    )
}
